CREATE TABLE `users` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `uuid` char(36) NOT NULL,
  `firstname` varchar(255) NOT NULL DEFAULT 'firstname',
  `lastname` varchar(255) DEFAULT NULL,
  `email` varchar(255) DEFAULT NULL,
  `phone` varchar(255) DEFAULT NULL,
  `birthday` date DEFAULT NULL,
  `gender` enum('male','female') NOT NULL DEFAULT 'male',
  `email_verified_at` timestamp NULL DEFAULT NULL,
  `phone_verified_at` timestamp NULL DEFAULT NULL,
  `ip_address` varchar(45) DEFAULT NULL,
  `active` tinyint(1) NOT NULL DEFAULT '1',
  `erpgo_connected` tinyint(1) NOT NULL DEFAULT '0' COMMENT 'Whether user is connected to ERPGo business management',
  `erpgo_user_id` varchar(255) DEFAULT NULL COMMENT 'User ID in ERPGo system',
  `erpgo_connected_at` timestamp NULL DEFAULT NULL COMMENT 'When ERPGo connection was established',
  `erpgo_access_token` varchar(255) DEFAULT NULL COMMENT 'ERPGo OAuth access token',
  `erpgo_refresh_token` varchar(255) DEFAULT NULL COMMENT 'ERPGo OAuth refresh token',
  `erpgo_token_expires_at` timestamp NULL DEFAULT NULL COMMENT 'When ERPGo access token expires',
  `img` varchar(255) DEFAULT NULL,
  `firebase_token` longtext,
  `password` varchar(255) DEFAULT NULL,
  `verify_token` char(36) DEFAULT NULL,
  `my_referral` varchar(255) DEFAULT '77iYlSjS',
  `referral` varchar(255) DEFAULT NULL,
  `remember_token` varchar(100) DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  `tg_user_id` bigint unsigned DEFAULT NULL,
  `currency_id` bigint unsigned DEFAULT NULL,
  `language_id` bigint unsigned DEFAULT NULL,
  `location` varchar(255) DEFAULT NULL,
  `kitchen_id` bigint unsigned DEFAULT NULL,
  `isWork` tinyint(1) NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`),
  UNIQUE KEY `users_email_unique` (`email`),
  UNIQUE KEY `users_phone_unique` (`phone`),
  KEY `users_uuid_index` (`uuid`),
  KEY `users_currency_id_foreign` (`currency_id`),
  KEY `users_language_id_foreign` (`language_id`),
  KEY `erpgo_connection_idx` (`erpgo_connected`,`erpgo_user_id`),
  KEY `email_erpgo_idx` (`email`,`erpgo_connected`)
) ENGINE=InnoDB AUTO_INCREMENT=893 DEFAULT CHARSET=utf8mb3;

